import React from "react";
import JsonData from "../../data.json";
import CardDetails from "../Card Details/CardDetails";

const Trending = () => {
  const trendingContent = JsonData.filter(
    (trending) => trending.isTrending === true
  );
  return (
    <>
      <CardDetails relevantData={trendingContent} />
    </>
  );
};

export default Trending;
